import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import "./Login.css";

export default function EmployeeLogin() {
    const [mobileNo, setMobileNo] = useState("");
    const [password, setPassword] = useState("");
    const [errorMessage, setErrorMessage] = useState("");
    const navigate = useNavigate();

    const handleLogin = async () => {
        try {
            // Send login data to the backend
            const response = await axios.post("http://localhost:8085/api/employees/login", {
                mobileNo,
                password,
            });

            if (response.status === 200) {
                alert("Login Successful!");
                navigate("/empdash/dashboard");
            }
        } catch (error) {
            setErrorMessage(
                error.response?.data || "Invalid mobile number or password."
            );
            console.error("Login error:", error);
        }
    };

    return (
        <div className="unique-login-page">
            <div className="unique-login-container">
                <div className="unique-form-container">
                    <Link to="/loginc" className="signup-link">Back</Link>
                    <h1 className="unique-form-title">Employee</h1>
                    <h2 className="unique-form-title">Sign In</h2>
                    <form
                        className="unique-form unique-signin-form"
                        onSubmit={(e) => e.preventDefault()}
                    >
                        <div className="unique-form-group">
                            <label htmlFor="mobileNo">Mobile Number</label>
                            <input
                                className="unique-form-input"
                                type="text"
                                name="mobileNo"
                                placeholder="Enter your mobile number"
                                value={mobileNo}
                                onChange={(e) => setMobileNo(e.target.value)}
                            />
                        </div>
                        <div className="unique-form-group">
                            <label htmlFor="password">Password</label>
                            <input
                                className="unique-form-input"
                                type="password"
                                name="password"
                                placeholder="Enter your password"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                            />
                        </div>
                        <div className="unique-form-options">
                            <label className="unique-checkbox-label">
                                <input type="checkbox" id="keepSignedIn" />
                                Keep me signed in
                            </label>
                        </div>
                        {errorMessage && (
                            <p className="error-message">{errorMessage}</p>
                        )}
                        <button
                            type="button"
                            className="unique-form-submit-button"
                            onClick={handleLogin}
                        >
                            Sign In
                        </button>
                    </form>
                </div>
            </div>
        </div>
    );
}
